"use strict";
import {scaler, ImageProcessor} from "../doppel/index";

var jpg = "data:image/jpeg;base64,";
var sourceImage = document.createElement('img'); // Assume this is your source image
sourceImage.onload = () => {
    var canvas = scaler.processImage(sourceImage, 90, 90).canvas;
    var canvas2 = new OffscreenCanvas(90, 90);
    var context2 = canvas2.getContext("2d");
        context2.imageSmoothingEnabled = false;
        context2.drawImage(sourceImage, 0, 0, sourceImage.width, sourceImage.height, 0, 0, canvas2.width, canvas2.height);

    var newCanvas = document.createElement("canvas");
        newCanvas.width = canvas.width * 10;
        newCanvas.height = canvas.height * 5;
    var newCanvasContext2D = newCanvas.getContext("2d");
        newCanvasContext2D.imageSmoothingEnabled = false;
        newCanvasContext2D.drawImage(canvas2, 0, 0, canvas2.width, canvas2.height, 0, 0, newCanvas.width/2, newCanvas.height)
        newCanvasContext2D.drawImage(canvas, 0, 0, canvas.width, canvas.height, canvas.width*5, 0, newCanvas.width/2, newCanvas.height)
    console.log(newCanvas.toDataURL())
};
sourceImage.src = jpg;

module.exports = {
    scaler: scaler,
    ImageProcessor: ImageProcessor
}